INSERT INTO `products` VALUES (20,'Điện thoại Samsung Galaxy S23+ 5G 256GB',' Samsung Galaxy S23+ 5G 256GB là chiếc điện thoại thuộc dòng cao cấp nhất của Samsung được giới thiệu vào tháng 02/2023.Máy sở hữu một con chip Snapdragon 8 Gen 2 mạnh mẽ hàng đầu giới điện thoại Android.',18990000,'Điện Thoại',_binary '',1,'SAMSUNG'),(21,'Điện thoại Samsung Galaxy S23 Ultra 5G 256GB','Samsung Galaxy S23 Ultra 5G 256GB là chiếc smartphone cao cấp nhất của nhà Samsung, sở hữu cấu hình không tưởng với con chip khủng được Qualcomm tối ưu riêng cho dòng Galaxy ',23990000,'Điện Thoại',_binary '',1,'SAMSUNG '),(24,'Điện thoại Samsung Galaxy Z Flip5 5G 512GB','Samsung GalaAxy Z Flip5 5G 512GB cũng đã chính thức ra mắt, được xem là một kiệt tác về thiết kế độc đáo đầy cuốn hút, thiết bị này hứa hẹn sẽ làm say đắm lòng người bởi vẻ ngoài vuông vắn tinh tế, khả năng gập độc đáo theo hướng dọc cùng cấu hình mạnh mẽ hàng đầu trong ngành',21990000,'Điện Thoại',_binary '',1,'SAMSUNG'),(25,'Điện thoại Samsung Galaxy S22 Ultra 5G 128GB','Galaxy S22 Ultra 5G chiếc smartphone cao cấp nhất trong bộ 3 Galaxy S22 series mà Samsung đã cho ra mắt và lần nữa S22 Ultra 5G tiếp tục trở lại đầy ngoạn mục mang đến 1 diện mạo mới khi tích hợp bút S Pen hoàn hảo trong thân máy, trang bị vi xử lý mạnh mẽ cho các tác vụ sử dụng vô cùng mượt mà và nổi bật hơn với cụm camera không viền độc đáo mang đậm dấu ấn riêng và có mức giá bán siêu hấp dẫn.',16990000,'Điện Thoại',_binary '',2,'SAMSUNG'),(26,'Điện thoại Samsung Galaxy S21 FE 5G (8GB/256GB)','Samsung Galaxy S21 FE 5G (8GB/256GB) - siêu phẩm hội tụ những đột phá mà mọi fan hằng mơ ước, hứa hẹn mang đến trải nghiệm đỉnh cao trong mọi khoảnh khắc với vẻ ngoài đầy năng động, hiệu năng mạnh mẽ với CPU cây nhà lá vườn Exynos 2100 ',11990000,'Điện Thoại',_binary '',2,'SAMSUNG'),(27,'Điện thoại OPPO Find N3 Flip 5G Hồng','OPPO Find N3 Flip 5G Hồng được OPPO cho ra mắt chính thức tại thị trường Việt Nam vào tháng 10/2023. Sản phẩm được hãng đầu tư mạnh mẽ về camera với độ phân giải lên đến 50 MP, cấu hình sử dụng chip Dimensity 9200 5G',22990000,'Điện Thoại',_binary '',3,'OPPO'),(28,'Điện thoại OPPO A38 ','OPPO A38 mẫu điện thoại tầm trung mới nhất được OPPO mang đến cho người tiêu dùng vào nửa cuối năm 2023. Máy sở hữu lối thiết kế quen thuộc của dòng điện thoại OPPO A, đồng thời có một hiệu năng ổn định cùng màn hình hiển thị sắc nét chắc chắn sẽ không làm bạn thất vọng.',4190000,'Điện Thoại',_binary '',2,'OPPO'),(29,'Điện thoại OPPO A57 128GB','OPPO đã bổ sung thêm vào dòng sản phẩm OPPO A giá rẻ một thiết bị mới có tên OPPO A57 128GB. Khác với mẫu A57 5G đã được ra mắt trước đó, điện thoại dòng A mới có màn hình HD+, camera chính 13 MP và pin 5000 mAh.',3790000,'Điện Thoại',_binary '',2,'OPPO'),(30,'Điện thoại xiaomi Redmi 13C','Xiaomi là một trong những nhà sản xuất hàng đầu thế giới trong lĩnh vực này, và Xiaomi Redmi 13C là một ví dụ điển hình cho thấy nỗ lực của họ trong việc mang đến những sản phẩm chất lượng với giá cả phải chăng.',3090000,'Điện Thoại',_binary '',1,'XIAOMI'),(31,'Điện thoại Xiaomi 13T 5G 8GB','Xiaomi 13T 5G là một thiết bị độc đáo được ra mắt tại thị trường Việt Nam vào tháng 09/2023. Sản phẩm này đang thu hút sự chú ý lớn từ cộng đồng người dùng',10990000,'Điện Thoại',_binary '',1,'XIAOMI'),(32,'Điện thoại iPhone 15 Pro Max 256GB','iPhone 15 Pro Max là một chiếc điện thoại thông minh cao cấp được Apple phát hành vào năm 2023. Đây là phiên bản cao cấp nhất của dòng iPhone 15, với màn hình lớn, hiệu năng mạnh mẽ và hệ thống camera tiên tiến.',30160000,'Điện Thoại',_binary '',2,'APPLE'),(33,'Điện thoại iPhone 14 Pro Max 128GB','iPhone 14 Pro Max một siêu phẩm trong giới smartphone được nhà Táo tung ra thị trường vào tháng 09/2022. Máy trang bị con chip Apple A16 Bionic vô cùng mạnh mẽ, đi kèm theo đó là thiết kế hình màn hình mới, hứa hẹn mang lại những trải nghiệm đầy mới mẻ ',23590000,'Điện Thoại',_binary '',3,'APPLE'),(34,'Điện thoại iPhone 15 128GB','IPhone 15 có màn hình OLED 6,1 inch với độ phân giải 2532 x 1170 pixel và tần số quét 120Hz. Màn hình này có chất lượng hiển thị tốt, với màu sắc sống động, độ sáng cao và tốc độ làm tươi mượt mà.',21990000,'Điện Thoại',_binary '',1,'APPLE'),(35,'Laptop Apple MacBook Air 13 inch M1 2020 8-core CPU/8GB/256GB/7-core GPU (MGN63SA/A)','Laptop Apple MacBook Air M1 2020 thuộc dòng laptop cao cấp sang trọng có cấu hình mạnh mẽ, chinh phục được các tính năng văn phòng lẫn đồ hoạ mà bạn mong muốn, thời lượng pin dài, thiết kế mỏng nhẹ sẽ đáp ứng tốt các nhu cầu làm việc của bạn.',18990000,'Laptop',_binary '',2,'APPLE'),(36,'Laptop Acer Aspire 7 Gaming A715 76G 59MW i5 12450H/8GB/512GB/4GB RTX2050/144Hz/Win11 (NH.QMYSV.001)','Laptop Acer Aspire 7 Gaming A715 76G 59MW i5 12450H (NH.QMYSV.001) được trang bị hiệu năng mạnh mẽ từ chip Intel dòng H, card đồ hoạ rời, thiết kế tân tiến cùng một mức giá phải chăng. ',17990000,'Laptop',_binary '',2,'ACER'),(37,'Laptop Acer Aspire 5 Gaming A515 58GM 51LB i5 13420H/16GB/512GB/4GB RTX2050/Win11 (NX.KQ4SV.002)','Mẫu laptop gaming với mức giá tầm trung đến từ thương hiệu Acer vừa được lên kệ tại Thế Giới Di Động, sở hữu hiệu năng mạnh mẽ với con chip Intel Gen 13 dòng H hiệu năng cao, RAM 16 GB, card rời RTX cùng nhiều tính năng hiện đại.',16990000,'Laptop',_binary '',1,'ACER');
INSERT INTO `products` VALUES (38,'Laptop Asus TUF Gaming F15 FX506HF i5 11400H/8GB/512GB/4GB RTX2050/144Hz/Win11 (HN014W)','Với bộ vi xử lý Intel Core i5 dòng H mạnh mẽ và card đồ họa rời NVIDIA GeForce RTX 2050 4 GB, laptop Asus TUF Gaming F15 FX506HF là một trong những lựa chọn tuyệt vời cho các game thủ và những người dùng làm việc đa tác vụ hoặc liên quan đến đồ họa, kỹ thuật.',16990000,'Laptop',_binary '',2,'ASUS'),(39,'Laptop HP Gaming VICTUS 15 fa1139TX i5 12450H/16GB/512GB/4GB RTX2050/144Hz/Win11 (8Y6W3PA)','Dòng Gaming Victus là một mẫu laptop gaming độc đáo từ thiết kế đến hiệu năng của nhà HP. Chỉ với một mức giá tầm trung là bạn có thể sở hữu ngay chiếc laptop HP Gaming VICTUS 15 fa1139TX i5 12450H (8Y6W3PA) có thể cân mượt các tựa game cũng như hỗ trợ làm việc tối ưu nhất.',19990000,'Laptop',_binary '',3,'HP'),(40,'Laptop Apple MacBook Air 13 inch M2 2022 8-core CPU/8GB/256GB/8-core GPU (MLXY3SA/A)','một chiếc MacBook Air M2 với thiết kế hoàn toàn mới, độ dày không thay đổi tương tự như MacBook Pro, đánh bật mọi rào cản với con chip Apple M2 đầy mạnh mẽ.',26990000,'Laptop',_binary '',2,'APPLE'),(41,'Máy tính bảng Samsung Galaxy Tab A9+ WiFi','Samsung Galaxy Tab A9+ WiFi đã chính thức có mặt trên thị trường Việt Nam từ tháng 10/2023,  trang bị chip Snapdragon 695, cùng viên pin dung lượng 7040 mAh, máy tính bảng này hứa hẹn mang đến cho người dùng một trải nghiệm độc đáo và thú vị',5990000,'Máy Tính Bảng',_binary '',3,'SAMSUNG'),(43,'Máy tính bảng iPad Air 5 M1 WiFi 64GB','iPad Air 5 M1 WiFi 64 GB có nhiều tính năng đặc biệt: Kết nối Apple Pencil 2, Kết nối bàn phím rời, Micro kép, Mở khóa bằng vân tay, Nam châm và sạc cho Apple Pencil.',14090000,'Máy Tính Bảng',_binary '',3,'APPLE');
